/* fonts */
export const FontFamily = {
  interLightItalic: "Inter_light_italic",
  interRegular: "Inter_regular",
  poppinsRegular: "Poppins_regular",
  poppinsBold: "Poppins_bold",
  poppinsMedium: "Poppins_medium",
};
/* font sizes */
export const FontSize = {
  size_xl: 20,
};
/* Colors */
export const Color = {
  goldenrod: "#ffc85c",
  palegoldenrod: "#f2f3b5",
  black: "#000",
  gray_100: "#fffdfd",
};
/* Paddings */
export const Padding = {
  p_6xl: 25,
  p_3xs: 10,
};
/* border radiuses */
export const Border = {
  br_3xs: 10,
  br_7xl: 26,
  br_xl: 20,
  br_mini: 15,
};
